app.intent("Default Welcome Intent", (conv) => {
  usersTurnLetter = "";

  if(!conv.user.storage.userName) {
    conv.ask(new Permission({
      // context: 'How can I call you?',
      permissions: 'NAME'
    }));
  }
});

app.intent("Game start", (conv) => {
  conv.ask(`Let me explain you rules first: 
  you tell me the city and I should name the other city, 
  that starts with the last letter of yours.
  Let's say, you say: London, then I say: New York, then you should say the city that starts with k. 
  Ready? Name any city`);

  conv.ask(new Suggestions('Dnipro', 'Kyiv', 'Berlin', 'Shanghai', 'Tel Aviv'));
});

app.intent("Game cancelled", (conv) => {
  if(conv.data.userName) {
    conv.close(`No worries, ${conv.data.userName}! You can get back any time`);
  } else {
    conv.close(`As you wish. I'm always here.`);
  }
});

app.intent("Assistants turn", (conv, { 'geo-city' : city }) => {
  if((usersTurnLetter.length === 0) || (usersTurnLetter.length > 0 && city.toLowerCase().startsWith(usersTurnLetter))) {
    const lastLetter = city[city.length - 1];
    const nextCity = cities.find(item => item.city.toLowerCase().startsWith(lastLetter));

    usersTurnLetter = nextCity.city[nextCity.city.length - 1];
    const response = nextCity ? `My city is ${nextCity.city}. Your turn. Start with ${usersTurnLetter}` : "Ooops, looks like I lost";
    conv.ask(response);
  } else {
    //User makes a mistake
    conv.ask(`Hmmm, I don't think the city starts with ${usersTurnLetter}`);
  }
});

app.intent("User lost", (conv) => {
  if(conv.data.userName) {
    conv.close(`No worries, ${conv.data.userName}! Next time you'll get lucky for sure`);
  } else {
    conv.close(`Don't be sad, next time you'll get lucky for sure`);
  }
});

app.intent('actions_intent_PERMISSION', (conv, params, permissionGranted) => {
  if (!permissionGranted) {
    conv.ask(`No probs. Wanna play a game?`);
  } else {
    conv.data.userName = conv.user.name.display;
    conv.ask(`Hey, ${conv.data.userName}. Wanna play a game?`);
    conv.ask(new Suggestions('Yes', 'No'));
  }
});

app.intent('actions_intent_CANCEL', (conv) => {
  if(conv.data.userName) {
    conv.close(`I'll be waiting for you next time, ${conv.data.userName}!`);
  } else {
    conv.close(`Buy!`);
  }
});

